function State(node, path) {
    this.node = node;
    this.path = path;

    // 展示在可视化面板上
    this.val = `${node.val}:${path.join('->')}`;
}

// 输入二叉树的根节点，返回所有从根节点到叶子节点的路径
var findAllPaths = function(root) {
    if (root === null) {
        return [];
    }

    const res = [];

    // BFS 遍历二叉树
    // @visualize bfs
    const q = [];
    q.push(new State(root, [root.val]));

    while (q.length > 0) {
        let cur = q.shift();
        let node = cur.node;
        let path = cur.path;
        // @visualize color *node #7ed67e

        if (node.left === null && node.right === null) {
            // @visualize color *node #6ccff9
            res.push(path);
            continue
        }

        if (node.left !== null) {
            let newPath = path.slice();
            newPath.push(node.left.val);
            q.push(new State(node.left, newPath));        
        }

        if (node.right !== null) {
            let newPath = path.slice();
            newPath.push(node.right.val);
            q.push(new State(node.right, newPath));
        }
    }

    return res;
};

